member.example:
This sample shows how to read a zip file

            using System;
            using System.Text;
            using System.IO;

            using CanYouLib.SharpZipLib.Zip;

            class MainClass
            {
            	public static void Main(string[] args)
            	{
            		using ( ZipInputStream s = new ZipInputStream(File.OpenRead(args[0]))) {

            			ZipEntry theEntry;
            			while ((theEntry = s.GetNextEntry()) != null) {
            				int size = 2048;
            				byte[] data = new byte[2048];

            				Console.Write("Show contents (y/n) ?");
            				if (Console.ReadLine() == "y") {
            					while (true) {
            						size = s.Read(data, 0, data.Length);
            						if (size > 0) {
            							Console.Write(new ASCIIEncoding().GetString(data, 0, size));
            						} else {
            							break;
            						}
            					}
            				}
            			}
            		}
            	}
            }

This sample shows how to unzip a gzipped file

           using System;
           using System.IO;

           using CanYouLib.SharpZipLib.Core;
           using CanYouLib.SharpZipLib.GZip;

           class MainClass
           {
           	public static void Main(string[] args)
           	{
           		using (Stream inStream = new GZipInputStream(File.OpenRead(args[0])))
           		using (FileStream outStream = File.Create(Path.GetFileNameWithoutExtension(args[0]))) {
           			byte[] buffer = new byte[4096];
           			StreamUtils.Copy(inStream, outStream, buffer);
           		}
           	}
           }

