Process an HSSF Record. Called when a record occurs in an HSSF file. Provides two options for halting the Processing of the HSSF file.
The return value provides a means of non-error termination with a user-defined result code. A value of zero must be returned to continue Processing, any other value will halt Processing by HSSFEventFactory with the code being passed back by its abortable Process events methods.
Error termination can be done by throwing the HSSFUserException.
Note that HSSFEventFactory will not call the inherited Process
@return result code of zero for continued Processing.
@throws HSSFUserException User code can throw this to abort file Processing by HSSFEventFactory and return diagnostic information.

member.example:
This sample shows how to create a zip file

            using System;
            using System.IO;

            using CanYouLib.SharpZipLib.Core;
            using CanYouLib.SharpZipLib.Zip;

            class MainClass
            {
            	public static void Main(string[] args)
            	{
            		string[] filenames = Directory.GetFiles(args[0]);
            		byte[] buffer = new byte[4096];

            		using ( ZipOutputStream s = new ZipOutputStream(File.Create(args[1])) ) {

            			s.SetLevel(9); // 0 - store only to 9 - means best compression

            			foreach (string file in filenames) {
            				ZipEntry entry = new ZipEntry(file);
            				s.PutNextEntry(entry);

            				using (FileStream fs = File.OpenRead(file)) {
           						StreamUtils.Copy(fs, s, buffer);
            				}
            			}
            		}
            	}
            }

